Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty of Counts 1 and 2 as charged in the Amended Information and ordered a Judgment of Conviction be entered into the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  The Court sentenced the defendant as follows:

AS TO COUNT 01:
The Court imposed but stayed 6 months at the House of Correction, Huber for work and child care; good time allowed, and placed defendant on probation for two (2) years.

AS TO COUNT 02:
The Court imposed but stayed 6 months at the House of Correction, consecutive to Count 1, with Huber for work and child care; good time allowed, and placed defendant on probation for two (2) years, concurrent to Count 1.

CONDITIONS OF PROBATION:
 - No controlled substances other than those legally prescribed for defendant by a duly licensed physician for her mental or physical needs; be taken as directed and for only as long as deemed medically and reasonably necessary;
 - Notify doctor(s) of opiate addiction;
 - No alcohol;
 - Urine screens;
 - AODA assessment; treatment if needed;
 - No contact with the victim, Jodee C.;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Parenting classes/counseling;
 - Pay restitution to Jodee C. in the amount of $4,867.87, plus DNA surcharge, plus all costs, fees and disbursements; pay supervision fees.  Failure to pay amounts in full would result in a civil judgment entered against defendant which is non-dischargeable in bankruptcy.

Filed,
Notice of Right to Seek Postconviction Relief.
